def get_lat
    n = Random.new.rand(0..1)
    if n == 0 
        return "10.#{Random.new.rand(921597385708730..998824941680496)}".to_f
    else
        value = Random.new.rand(1133114538126..24217645010303).to_s
        value = "0" + value if value.size == 13
        return "11.0#{value}".to_f
    end    
end

def get_lng
    "-74.#{Random.new.rand(77340651576577..84369937519568)}".to_f
end

def generate_plate
    Array.new(3) { CHARSET.sample }.join + Array.new(3) { NUMBER_CHARSET.sample }.join
end

def move_cars(array)

    array.each_with_index do |a, index|

        lat = get_lat
        lng = get_lng

        # puts "move_cars #{index}: #{lat}, #{lng}"

        array[index][:location][:lat] = lat
        array[index][:location][:lng] = lng
        array[index][:location][:rotation] = Random.new.rand(0..360)
    end

    return array

end

def generate_array(n)
    array = []
    (1..n).each do |i|
        plate = generate_plate

        lat = get_lat
        lng = get_lng
    
        body = {
            driver: {
                id: i,
                cc: i
            },
            car: {
                id: i,
                plate: plate
            },
            location: {
                lat: lat,
                lng: lng,
                rotation: Random.new.rand(0..360),
                alt: 0
            },
            state: 1,
            date: DateTime.now.to_s,
            transportCompanyId: 1
        }

        array << body        
    end
    return array
end

def generate_objects(plates)
    array = []
    plates.each_with_index do |plate, i|
        

        # lat = "#{10.9}#{(Random.new.rand * 100000).to_i}".to_f
        # lng = "#{-74.8}#{(Random.new.rand * 100000).to_i}".to_f

        lat = get_lat
        lng = get_lng
    
        body = {
            driver: {
                id: i + 1,
                cc: (i + 1).to_s
            },
            car: {
                id: i + 1,
                plate: plate
            },
            location: {
                lat: lat,
                lng: lng,
                rotation: Random.new.rand(0..360),
                alt: 0
            },
            state: 1,
            date: DateTime.now.to_s,
            transportCompanyId: 1
        }

        array << body        
    end
    return array
end

def multi_send(array)
    sw = true
    while sw do
        EventMachine.run do
            multi = EventMachine::MultiRequest.new

            array.each_with_index do |body, index|
                # puts "json #{body.to_json}"
                multi.add(index + 1, EventMachine::HttpRequest.new('http://192.168.0.101:82/v1/location_records').post(:head => {"Content-Type" => "application/json"}, :body => body.to_json))
            end

            multi.callback do   
                puts "success: #{multi.responses[:callback].keys.size}"
                puts "failed: #{multi.responses[:errback].keys.size}"                
                
                if multi.responses[:errback].keys.empty?                
                    # sleep(1)
                else         
                    # puts multi.responses[:errback]
                    # multi.responses[:errback].each do |key, value|                        
                    #     # puts "error: #{value.error}"
                    #     # body = JSON.parse(value.req.body)
                    #     # puts "#{body['location']['lat']}, #{body['location']['lng']}"
                    # end                                       
                    # sw = false             
                end

                array = move_cars(array)
                
                EventMachine.stop
            end
        end
    end
end

def multi_send_part(size, plates)
    n = plates.size / size
    (0..n - 1).each do |index|
        bound_init = index * size
        bound_end = bound_init + size - 1
        puts "bounds: [#{bound_init}, #{bound_end}]"
        array = generate_objects( plates[bound_init..bound_end] )
        EventMachine.run do
            multi = EventMachine::MultiRequest.new

            array.each_with_index do |body, index|
                # puts "json #{body.to_json}"
                multi.add(index + 1, EventMachine::HttpRequest.new('http://192.168.0.101:82/v1/location_records').post(:head => {"Content-Type" => "application/json"}, :body => body.to_json))
            end

            multi.callback do   
                puts "success: #{multi.responses[:callback].keys.size}"
                puts "failed: #{multi.responses[:errback].keys.size}"                
                
                if multi.responses[:errback].keys.empty?                
                    sleep(1)
