                    #     # body = JSON.parse(value.req.body)
                    #     # puts "#{body['location']['lat']}, #{body['location']['lng']}"
                    # end                                       
                    # sw = false             
                end

                array = move_cars(array)
                
                EventMachine.stop
            end
        end
    end
end


